@matyhtf if you want listen to port 0, you just need
<?php
$serv->listen('127.0.0.1', 0, SWOOLE_SOCK_TCP);

$serv->on('managerStart', function (Swoole\Server $s) {
    var_dump($s->ports);
    // send host:port to etcd, zookeeper ...
});
There is no nore extra thing to do.

