上一次PR 提交错了...
$swoole -> new \swoole_websocket_server($this->http_socket_name, $this->http_port);
// $swoole->on('connect', [$this, 'onSwooleConnect']); 主端口没有设置回调
.....
$port = $swoole_server->addListener(string $host, int $port, $type = SWOOLE_SOCK_TCP);
$this->port->on('connect', [$this, 'onSwooleConnect']); // 增加新端口监听tcp时设置回调
这种情况下出现 在回调时是 signal SIGSEGV 错误，而重启worker进程服务，反正数据正常。
原因 php_swoole_server_get_cache,方法返回的是空地址。
错误定位在 coro_create :zend_function *func = fci_cache->function_handler;
我暂时这样修改，其实是否应该指定端口的回调。

