@matyhtf
If this PR merged, the user can start two processes that listen same port.
You can run two instances of test2.php same time.
This is useful:
User can start a new process to serve the new request, and stop the old process.
This typical seamless upgrade.

test2.php
<?php
// this code need this pr to be merged
$http = new \swoole_http_server("127.0.0.1", 9501, SWOOLE_PROCESS, SWOOLE_SOCK_TCP, SWOOLE_SO_REUSEADDR|SWOOLE_SO_REUSEPORT);
$http->on('request', function ($request, $response) {
    $response->end("Hello Swoole. \n");
});
$http->start();

