#1786 solved by adding a callback named onWebSocketClose.
Thanks for the inspiring of @刘冰 at https://wiki.swoole.com/wiki/page/400.html. I find this elegant method for solving it (avoid the dependency between swoole_websocket_server and swoole_server).
Example for onWebSocketClose callback:
$server = new swoole_websocket_server("0.0.0.0", 9502);

$server->on('close', function($server, $fd, $id) {
    echo "connection close: {$fd}\n";
});

$server->on('websocketclose', function($server, $code, $reason) {
    echo "connection close socket: {$code} Reason:{$reason}\n";
});
Test preparing

